import { baseURL } from "./OpenAI";
import React from "react";
import axios from "axios";

class OpenAINLP extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            openAIresponse: {
                names: [],
                specie: "",
            },
        };

    }

    GetPetNames(specieInput) {
        axios
         .post(baseURL + "nlp-pet-name-fake/specie/" + specieInput)
         .then((response) => {
            this.state.openAIresponse.names = response.data.names;
            this.state.openAIresponse.specie = response.data.specie;
            // console.log(this.state.openAIresponse);
         })
         .catch((error) => {
            console.log(error);
         });
    }  
}

export default OpenAINLP;
